import React, { Component } from 'react';

class AdminProjectListElement extends Component {
  state = {};
  editUrl = '/editproject/' + this.props.project._id;
  deleteUrl = '/deleteproject/' + this.props.project._id;

  componentDidMount() {
    console.log(this.props.project);
  }

  render() {
    return (
      <tr>
        <td>{this.props.project.tittle}</td>
        <td>
          <a href={this.editUrl}>Edit</a>
        </td>
        <td>
          <a href={this.deleteUrl}>Delete</a>
        </td>
      </tr>
    );
  }
}

export default AdminProjectListElement;
